import image4 from "../img/portfolio/4.png";
import { Link } from "react-router-dom";

const Portfolio = () => {
  return (
    <div className="section">
      <div className="container mx-auto h-full relative">
        {/** text  */}

        <div className="flex flex-col lg:items-start">
          <h1 className="h1"> portfolio</h1>
          <p>
            {" "}
            Aryan is a highly skilled and versatile visual artist who excels in
            both photography and videography. With an innate talent for
            capturing moments and telling stories through a lens, Aryan's
            portfolio is a captivating collection of artistic works that
            showcase his exceptional creativity and technical prowess. Whether
            it's capturing breathtaking landscapes, candid portraits, or t{" "}
          </p>
          <Link to="/contact" className="btn mb-[30px] mx-auto lg:mx-0">
            Hire Me
          </Link>
        </div>
        {/** imgs  grid  */}
        <div 
        className='grid grid-cols-2 lg:gap-2'>
          {/* image */}
          <div className='max-w-[250px] lg:max-w-[320px] h-[187px] lg:h-[220px] bg-accent overflow-hidden'>
            <img
              className='object-cover h-full lg:h-[220px] hover:scale-110 transition-all duration-500'
              src={image1}
              alt=''
            />
          </div>
          <div className='max-w-[250px] lg:max-w-[320px] h-[187px] lg:h-[220px] bg-accent overflow-hidden'>
            <img
              className='object-cover h-full lg:h-[220px] hover:scale-110 transition-all duration-500'
              src={image2}
              alt=''
            />
          </div>
          <div className='max-w-[250px] lg:max-w-[320px] h-[187px] lg:h-[220px] bg-accent overflow-hidden'>
            <img
              className='object-cover h-full lg:h-[220px] hover:scale-110 transition-all duration-500'
              src={image3}
              alt=''
            />
          </div>
          <div className='max-w-[250px] lg:max-w-[320px] h-[187px] lg:h-[220px] bg-accent overflow-hidden'>
            <img
              className='object-cover h-full lg:h-[220px] hover:scale-110 transition-all duration-500'
              src={image4}
              alt=''
            />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Portfolio;
